import React from 'react';
import { Stack,Grid } from '@mui/material';

export default function Home() {
  return (
  <Stack spacing={0} direction="column" alignItems="center">
      <Grid container alignItems="center" justifyContent="center" sx={{ bgcolor: '#cfe8fc', height: '25rem', width:'80%'}}>
        <h1>Hello World</h1>
      </Grid>
      <Grid container alignItems="center" justifyContent="center"sx={{ bgcolor: '#00344A', height: '25rem', width:'80%'}}>
        <h1>Hello World</h1>
      </Grid>
  </Stack>
  );
}
